n_qubits = 133
print(f"Total stabilizers: {len(stabilizers)}")
print(f"Qubit count: {n_qubits}")

# Check all lengths
for i, s in enumerate(stabilizers):
    if len(s) != n_qubits:
        print(f"Warning: stabilizer {i} has length {len(s)}, expected {n_qubits}")

# Check commutativity
def check_commute(s1, s2):
    count = 0
    for c1, c2 in zip(s1, s2):
        if c1 != 'I' and c2 != 'I' and c1 != c2:
            count += 1
    return count % 2 == 0

anticomm = []
for i in range(len(stabilizers)):
    for j in range(i+1, len(stabilizers)):
        if not check_commute(stabilizers[i], stabilizers[j]):
            anticomm.append((i, j))

print(f"Anticommuting pairs: {len(anticomm)}")
if anticomm:
    for p in anticomm[:10]:
        print(f"  {p}")
